import { Component, Renderer2, ElementRef, ViewChild, ViewChildren, QueryList, OnInit, AfterViewChecked } from '@angular/core';
import { ActivatedRoute } from '@angular/router'; 
import { Location } from '@angular/common'
import { Observable } from 'rxjs';
import { DeviceDetectorService } from 'ngx-device-detector';
import jspdf from 'jspdf';
import { FormController, FieldsController } from '../controller';
import { FormDetail, FormResponse, FieldDetail } from '../graphql';
import { FormFieldComponent } from '../formPages/formField.component';

@Component({
  templateUrl: './guideSpecific.page.html',
  styleUrls: ['./guide.css'] 
})
          
export class GuideSpecific implements OnInit {
  guideUri: string
  guide: Observable<FormDetail>
  fields: Observable<FieldDetail[]>
  hasLoaded = false  
  pdfLoading = false
  isPDF = false
  isLeader = false
  isBlank = false
  @ViewChildren('formField') fieldComponents:QueryList<FormFieldComponent>
  pageData: any[]
  temp: any
  spacer: any
  loadingText = "Loading..."
  
  constructor(private location: Location,
              private route: ActivatedRoute,
              private formController: FormController,
              private fieldsController: FieldsController,
              private renderer: Renderer2,
              private el: ElementRef,
              private deviceService: DeviceDetectorService) {  
  }
  
  ngOnInit() {
    this.guideUri = this.route.snapshot.paramMap.get('guideUri'); 
    
    this.route.queryParams.subscribe(params => {
      if (params.pdf === 'true') {
        this.isPDF = true;
        this.loadingText = "PDF Generating..."
      }
      if (params.leader === 'true') {
        this.isLeader = true;
      }
      if (params.blank === 'true') {
        this.isBlank = true;
      }      
    })
  
  
    this.formController.getFormByUri(this.guideUri).then(value => {
        this.guide = this.formController.getForm();
        
      
      this.guide.subscribe(guide => {
          this.fieldsController.getFormFields(guide.formstackId).then(value => {
            if (this.isPDF) {
              setTimeout(() => {this.createPDF(this.deviceService.getDeviceInfo(), guide),10000})
            } else {
              setTimeout(() => {this.hasLoaded = true},0)
            }
          })            
          this.fields = this.fieldsController.getFields();
        }
      )
      
      
    })
    
  }
  
 onBack() {
   this.location.back();
 }
  
 createPDF(deviceInfo, guideInfo): void {
    this.temp = this.renderer.createElement('div');
    this.spacer = this.renderer.createElement('div');
   
    if (deviceInfo.os == "Android") {
      setTimeout(() => {(this.hasLoaded = true),100})
    }
    let pdfWidth = 540
    let pdfHeight = 842
    let currentPageHeight = 60
    
    let AvenirRegularFont = ""
    let AvenirDemiFont = ""
    let doc = new jspdf('p' ,'pt', 'a4');
    doc.addFileToVFS("AvenirRegular.ttf", AvenirRegularFont)
    doc.addFont('AvenirRegular.ttf', 'AvenirRegular', 'normal')
    doc.addFileToVFS("AvenirDemi.ttf", AvenirDemiFont)
    doc.addFont('AvenirDemi.ttf', 'AvenirDemi', 'normal')

    doc.setFont('AvenirRegular')
    doc.setProperties({
      title: "Liquid Group Guide",
      subject: "Liquid Group Guide",
      author: "Liquid Church"
    })
    
    //this.renderer.setStyle(this.spacer, 'height', (pdfHeight) + 'px')
    //this.renderer.appendChild(this.temp, this.spacer)
   
    this.renderer.setStyle(this.temp, 'width', pdfWidth + 'px')
        
    for(var i = 0; i < this.fieldComponents.toArray().length; i++){      
      this.fieldComponents.toArray()[i].elementView.nativeElement.style.width = pdfWidth + 'px';

      if (this.fieldComponents.toArray()[i].elementView.nativeElement.offsetHeight + currentPageHeight > (pdfHeight - (120))) {
        let spacer = this.renderer.createElement('div');
        this.renderer.setStyle(spacer, 'height', ((pdfHeight - 10) - currentPageHeight + 0) + 'px')
        this.renderer.appendChild(this.temp, spacer)
        currentPageHeight = 60
      }
      
      if (this.fieldComponents.toArray()[i].field.type !== "embed") {
        currentPageHeight = this.fieldComponents.toArray()[i].elementView.nativeElement.offsetHeight + currentPageHeight
        this.renderer.appendChild(this.temp, this.fieldComponents.toArray()[i].elementView.nativeElement)
      }
    }
    doc.html(this.temp, {
      callback: function (doc) {
        if (deviceInfo.browser == 'Safari' && deviceInfo.device != "Desktop") {
          doc.output('datauri');
        } else if (deviceInfo.os == "Windows") {
          var blobPDF = new File([doc.output('blob')], 'group-guide.pdf', { type:'application/pdf'})
          var blobUrl = URL.createObjectURL(blobPDF)
          
          if (this.isBlank === true) {
            window.location.replace(blobUrl)
          } else {
            doc.save()
          }

        } else if (deviceInfo.os == "Mac") {
          var blobPDF = new File([doc.output('blob')], 'group-guide.pdf', { type:'application/pdf'})
          var blobUrl = URL.createObjectURL(blobPDF)
          window.location.replace(blobUrl)
        } else {
          doc.save()
          //window.close()
        }
      },
      x: 28,
      y: 15,
    })
  }  
}              